window.bookSummaryJSON = "<p><b>The </b><b><i>New York Times </i></b><b>bestselling “new Agatha Christie” (</b><b><i>Air Mail</i></b><b>) Ruth Ware returns with this adrenaline-fueled thriller that combines </b><b><i>Mr. and Mrs. Smith</i></b><b> with </b><b><i>The Fugitive</i></b><b> about a woman in a race against time to clear her name and find her husband’s murderer.</b></p> <p>Hired by companies to break into buildings and hack security systems, Jack and her husband, Gabe, are the best penetration specialists in the business. But after a routine assignment goes horribly wrong, Jack arrives home to find her husband dead. To add to her horror, the police are closing in on their suspect—her.</p> <p>Suddenly on the run and quickly running out of options, Jack must decide who she can trust as she circles closer to the real killer in this thoroughly enjoyable, heart-pounding mystery from an author whose “propulsive prose keeps listeners on the hook and refuses to let anyone off until all has been revealed” (<i>Shelf Awareness</i>).</p>"; 
